Calling methods in two different ReactiveMongoRepository's in a transaction using Spring Data MongoDB?<p>When using the reactive programming model with Spring Data MongoDB it's possible to execute transactions like this:</p>

<pre class="lang-java prettyprint-override"><code>Mono&lt;DeleteResult&gt; result = template.inTransaction()                                      
    .execute(action -&gt; action.remove(query(where("id").is("step-1")), Step.class)); 
</code></pre>

<p>But Spring Data MongoDB also has support for "reactive repositories", for example:</p>

<pre class="lang-java prettyprint-override"><code>public interface PersonRepository extends ReactiveMongoRepository&lt;Person, String&gt;

  Flux&lt;Person&gt; findByLocationNear(Point location, Distance distance);
}
</code></pre>

<p>and</p>

<pre class="lang-java prettyprint-override"><code>public interface CarRepository extends ReactiveMongoRepository&lt;Car, String&gt;

  Flux&lt;Car&gt; findByYear(int year);
}
</code></pre>

<p>My question is, given that you have <code>ReactiveMongoRepository</code>'s, can you somehow leverage MongoDB transactions and e.g. insert both a <code>Person</code> and <code>Car</code> in the same transaction (using <code>PersonRepository</code> and <code>CarRepository</code> in the case)? If so, how do you do this?</p>

