Using MergeObjects without overwriting subdocuments<p>I'm trying to merge two fields in my aggregation pipeline. </p>

<p>I want to transform this:</p>

<pre><code>{
   "a": 1,
   "b": {
      "first": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value"
      },
      "second": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value"
      },
      "third": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value"
      },
      "fiftieth": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value"
      }
   },
   "c": {
      "first": {
          "property_x": "some_value",
          "property_y": "some_value"
      },
      "second": {
          "property_x": "some_value",
          "property_y": "some_value"
      },
      "fiftieth": {
          "property_x": "some_value",
          "property_y": "some_value"
      }
   }
}
</code></pre>

<p>Into this, without having to specify every key listed under "b":</p>

<pre><code>{
   "a": 1,
   "b": {
      "first": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value",
          "property_x": "some_value",
          "property_y": "some_value"
      },
      "second": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value",
          "property_x": "some_value",
          "property_y": "some_value"
      },
      "third": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value"
      },
      "fiftieth": {
          "property_a": "some_value",
          "property_b": "some_value",
          "property_c": "some_value",
          "property_x": "some_value",
          "property_y": "some_value"
      }
   }
}
</code></pre>

<p>In the documentation for <code>mergeObjects</code>, it states:</p>

<blockquote>
  <p>mergeObjects overwrites the field values as it merges the documents. If documents to merge include the same field name, the field, in the resulting document, has the value from the last document merged for the field.</p>
</blockquote>

<p>How can I merge the subdocuments of fields b and c without specifying every key (there are 85 keys in my real world use case). Also, field c may not have every key listed under b. Or is this not possible? </p>

