<a href="https://i.stack.imgur.com/WA3qp.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/WA3qp.png" alt="enter image description here"></a></p>

<p>Falafel is an account in my application, accounts in my application can hold their customer's data such as phone numbers, ip, country, and more. Banana is an example for a customer of Falafel. Whenever someone new registers as a customer of Falafel, I need to check if Falafel already has a customer with the same phone ( in order to prevent someone from registering two times ). 
