Using MongoDB $arrayToObject and $map operators in java spring boot<p>I have a query in mongodb with aggregation framework, which returns number of topics in my documents. This is done by utilizing the $group operator and the result looks like:</p>

<pre class="lang-js prettyprint-override"><code>{
postsByTopics: [
        {
            "_id" : "Topic 1",
            "count" : 3.0
        },
        {
            "_id" : "Topic 2",
            "count" : 1.0
        }
    ]
}
</code></pre>

<p>I use projection to get a better shaped results</p>

<pre class="lang-js prettyprint-override"><code>{
"$project": {
        "postsByTopics": {
            "$arrayToObject": {
                "$map": {
                    "input": "$postsByTopics",
                    "as": "el",
                    "in": {
                        "k": "$$el._id",
                        "v": "$$el.count",
                    }
                }
            }
        },

}
</code></pre>

<p>which returns much nicer shaped result:</p>

<pre class="lang-js prettyprint-override"><code>{
postsByTopics: {
    "Topic1" : 3.0,
    "Topic2" : 1.0
    }
}
